import React from "react";
import { createRoot } from "react-dom/client";
import "./style.css";
import images from "./images"; // Import images relative to the current file

const root = createRoot(document.getElementById("root"));

function App() {
  return (
    <div>
      <Nav />
      <Search />
      <Pic />
    </div>
  );
}

function Nav() {
  return (
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home | </li>
        <li>Products | </li>
        <li>About | </li>
        <li>Contact | </li>
      </ul>
    </nav>
  );
}

function Search() {
  return (
    <div className="searchbar">
      <input type="text" placeholder="Search" />
    </div>
  );
}

function Pic() {
  return (
    <div className="products">
      <div className="box">
        <img src={images.one} alt="Fogg Wood Extreme" />
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>

      <div className="box">
        <img src={images.three} alt="villain" />
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>

      <div className="box">
        <img src={images.two} alt="Designs Club" />
        <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
      </div>
    </div>
  );
}

root.render(<App />);
